import React from "react";
import "./Header.css";
import deski_ash from "../assets/deski_ash.svg";
import { Link } from "react-router-dom";

function Header() {
    const style = {
        width: "100%",
    };
    return (
        <div>
            <header>
                <img src={deski_ash} alt="" height="60" width="110" />
                <div className="wrk_nav">
                    <Link to="/workplace" className="wrknav_links" onClick={style}>
                        Home
                    </Link>
                    <Link to="/feed" className="wrknav_links">
                        Feed
                    </Link>
                    <Link to="/templates" className="wrknav_links">
                        Templates
                    </Link>
                </div>
            </header>
        </div>
    );
}

export default Header;
